records.addlTxt:
Defendant Brandon A L Moore in court with attorney Stephen Michael Govin.   District Attorney's Office Law Intern appeared for the State of Wisconsin.  State files Amended Information. Defense acknowledges receipt.  Defendant enters a guilty plea as to Counts 1 and 2.  Court finds defendant guilty.  Court conducts plea colloquy with defendant.  State makes sentencing recommendation.  Defense makes sentencing recommendation.  Defendant makes statement.  

The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

COUNT 1:

6 MONTHS JAIL STRAIGHT

TERM OF PROBATION:  18 MONTHS

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety; Random U.A.'s; 
*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with:  victim or co-actors

COURT COSTS:  $253.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.



COUNT 2:

6 MONTHS JAIL STRAIGHT - CONSECUTIVE TO COUNT 1

TERM OF PROBATION:  18 MONTHS

CONDITIONS OF PROBATION:
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety; Random U.A.'s; 
*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with:  victim or co-actors

COURT COSTS:  $243.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.
